import React from "react";
import Table from "rc-table";

const data: any = [
  {
    displayDate: "5/14",
    rsvped: 5,
    attended: 2
  }
];

const columns = [
  {
    title: "Date",
    dataIndex: "displayDate",
    key: "displayDate"
  },
  {
    title: "RSVPs",
    dataIndex: "rsvped",
    key: "rsvped"
  },
  {
    title: "Attended",
    dataIndex: "attended",
    key: "attended"
  }
];

const AttendanceBySignupDateTable = () => {
  return <Table data={data} columns={columns} />;
};

export default AttendanceBySignupDateTable;
